    /// </summary>
    /// <param name="game"></param>
    /// <returns></returns>
    public static string GetGameName(this T3BlowfishKey game)
    {
        // Use reflection to get the Display attribute name if it exists
        FieldInfo? field = game.GetType().GetField(game.ToString());
        if (field == null)
        {
            return game.ToString();
        }

        var attribute = field.GetCustomAttributes(typeof(DisplayAttribute), false).FirstOrDefault() as DisplayAttribute;
        return attribute?.Name ?? game.ToString();
    }

